import Product from '../components/product';
import './styles/catalog.css';


const data=[
    {
        title: "Watermelon",
        price: 12.33,
        category: "fruit",
        image: "watermellon.jpg",
        _id: "1"
    },

    {
        title: "Banana",
        price: 17.33,
        category: "fruit",
        image: "banana.jpg",
        _id: "2"
    },

    {
        title: "Strawberries",
        price: 11.33,
        category: "fruit",
        image: "strawberry.jpg",
        _id: "3"
    },

    {
        title: "oranges",
        price: 16.33,
        category: "fruit",
        image: "oranges.jpg",
        _id: "4"
    } ,
    
    {
        title: "Pineapple",
        price: 18.33,
        category: "fruit",
        image: "pineapple.jpg",
        _id: "5"
    } ,
];  ///create around 5 products  read about react hooks


function Catalog(){
return(
    <div className="catalog">
        <h1>Check our catalog</h1>
        <Product info={data[0]}/>
        <Product info={data[1]}/>
        <Product info={data[2]}/>
    </div>
);
}

export default Catalog;
